const getPersonModel = (sequelize, { DataTypes }) => {
    const Person = sequelize.define("person", {
        id: {
            type: DataTypes.INTEGER,
            primaryKey: true,
            autoIncrement: true,
        },
        name: {
            type: DataTypes.STRING,
            allowNull: false,
        },
        age: {
            type: DataTypes.INTEGER,
            allowNull: false,
        },
        skills: {
            type: DataTypes.STRING,
            allowNull: false,
        },
        currentJob: {
            type: DataTypes.STRING,
            allowNull: false,
        },
        desiredJob: {
            type: DataTypes.STRING,
            allowNull: true,
        },
        description: {
            type: DataTypes.STRING,
            allowNull: false,
        }
    }, {
        hooks: {
            beforeValidate: (person) => {
                if (!person.desiredJob) {
                    person.desiredJob = person.currentJob;
                }
            }
        }
    });

    Person.associate = (models) => {
        Person.hasOne(models.Contact, {
            foreignKey: "personId",
            onDelete: "CASCADE",
        });

        Person.hasOne(models.Address, {
            foreignKey: "personId",
            onDelete: "CASCADE",
        });
    };

    Person.findById = async function (id) {
        return await this.findByPk(id, {
            include: [this.associations.contact, this.associations.address],
        });
    };

    Person.findAllPersons = async function () {
        return await this.findAll({
            include: [this.associations.contact, this.associations.address],
        });
    };

    Person.createPerson = async function (data) {
        return await this.create(data, {
            include: [this.associations.contact, this.associations.address],
        });
    };


    Person.updatePerson = async function (id, data) {
        const person = await this.findByPk(id, {
            include: [this.associations.contact, this.associations.address],
        });

        if (!person) return null;

        // Atualiza os campos da pessoa
        await person.update(data);

        // Atualiza o contato, se fornecido
        if (data.contact && person.contact) {
            await person.contact.update(data.contact);
        }

        // Atualiza o endereÃ§o, se fornecido
        if (data.address && person.address) {
            await person.address.update(data.address);
        }

        return person;
    };

    Person.deleteById = async function (id) {
        const person = await this.findByPk(id);
        if (!person) return null;
        await person.destroy();
        return person;
    };

    return Person;
};

module.exports = getPersonModel;

